import { Route, Routes } from "react-router";
import Welcome from "./Pages/Welcome";
import Users from "./Pages/Users";
import { Fragment } from "react";

function App() {
  return (
    <Fragment>
      <Route path="/welcome">
        <Welcome />
      </Route>
      <Route path="/users">
        <Users />
      </Route>
    </Fragment>
  );
}

export default App;
